(4, 'S', 'Bakat pandang ruang', 'Kemampuan berpikir secara visual mengenai bentuk-bentuk geometris, untuk memahami gambar-gambar dari benda-benda tiga dimensi', '2018-09-01 02:04:56', '0000-00-00 00:00:00'),
(5, 'P', 'Bakat penerapan Bentuk', 'Kemampuan menyerap perincian-perincian yang berkaitan dalam objek atau dalam gambar atau dalam bahan grafik', '2018-09-01 02:05:30', '0000-00-00 00:00:00'),
(6, 'Q', 'Bakat ketelitian', 'Kemampuan menyerap perincian yang berkaitan dalam bahan verbal atau dalam tabel.', '2018-09-01 02:06:14', '0000-00-00 00:00:00'),
(7, 'K', 'Koordinasi Motorik', 'Kemampuan untuk mengkoordinir mata dan tangan secara cepat dan cermat dalam membuat gerakan yang cepat.', '2018-09-01 02:07:01', '0000-00-00 00:00:00'),
(8, 'F', 'Kecekatan Jari', 'Kemampuan menggerakkan jari-jemari dengan mudah dan perlu keterampilan.', '2018-09-01 02:07:33', '0000-00-00 00:00:00'),
(9, 'E', 'Koordinasi Mata,Tangan, Kaki', 'Kemampuan menggerakkan tangan dan kaki secara koordinatif satu sama lain sesuai dengan rangsangan penglihatan.', '2018-09-01 02:08:00', '0000-00-00 00:00:00'),
(10, 'C', ' Kemampuan membedakan warna', 'Kemampuan memadukan atau membedakan berbagai warna yang asli, yang gemerlapan', '2018-09-17 03:39:16', '2018-09-17 03:39:16'),
(11, 'M', 'Kecekatan Tangan', 'Kemampuan menggerakkan tangan dengan mudah dan penuh keterampilan', '2018-09-01 02:09:13', '0000-00-00 00:00:00'),
(12, 'G', 'Intelekgensia', 'Kemampuan belajar secara umum.\r\n', '2018-09-17 03:41:03', '0000-00-00 00:00:00'),
(13, 'V', 'Bakat Verbal', 'Kemampuan untuk memahami arti kata-kata dan penggunaannya secara tepat dan efektif.\r\n', '2018-09-17 03:42:25', '0000-00-00 00:00:00'),
(15, 'N', 'Bakat Numerik', 'Kemampuan untuk melakukan operasi arithmatik secara tepat dan akurat.\r\n', '2018-09-17 03:43:07', '0000-00-00 00:00:00');
