INSERT INTO `master_fungsi_fisik` (`id`, `kode`, `nama`, `keterangan`, `created_at`, `updated_at`) VALUES
(1, 'B0', 'Memasang mesin', 'Menyesuaikan mesin untuk melakukan suatu pekerjaan tertentu dengan mema­sang, mengubah komponen-komponennya atau memperbaiki mesin menurut standar.', '2018-08-07 06:35:03', '0000-00-00 00:00:00'),
(2, 'B1', 'Mengerjakan persisi', 'Menggunakan anggota badan atau perkakas untuk mengerjakan, memindahkan, menga-rahkan atau menempatkan obyek secara tepat sesuai dengan standar yang telah ditetapkan dengan toleransi yang kecil.', '2018-08-14 07:21:25', '2018-08-14 07:21:25'),
(3, 'B2', 'Menjalankan - mengontrol mesin', 'Menghidupkan, menyetel, mengatur kerja dan menghentikan mesin serta mengamati berbagai alat petunjuk pada mesin.', '2018-08-14 07:21:55', '0000-00-00 00:00:00'),
(4, 'D0', 'Memadukan data', 'Menyatukan atau memadukan hasil analisis data untuk menemukan fakta menyusun karangan atau mengembangkan konsep, pengetahuan, interprestasi, menciptakan gagasan dengan menggunakan imajinasi.\r\n', '2018-08-14 07:22:26', '0000-00-00 00:00:00'),
(5, 'B3', 'Mengemudikan / menjalankan mesin', 'Menghidupkan, menghentikan, mengatur jalan mesin atau peralatan yang arahnya harus dikemudikan untuk memproses atau memindahkan benda atau orang. Dalam fungsi ini mesin sifatnya bergerak atau berjalan.', '2018-09-01 03:23:58', '0000-00-00 00:00:00'),
(6, 'B4', 'Mengerjakan benda dengan tangan atau perkakas', 'Menggunakan anggota badan, seperangkat alat perkakas tangan atau alat-alat khusus untuk mengerjakan, menggerakkan, menga-rahkan atau menempatkan benda.', '2018-09-01 03:24:49', '0000-00-00 00:00:00'),
(7, 'B5', 'Melayani mesin', 'Menghidupkan, menghentikan dan menga­mati kerja mesin beserta peralatannya.', '2018-09-01 03:25:48', '0000-00-00 00:00:00'),
(8, 'B6', 'Memasukkan, mengeluar kan barang ke/dari mesin', 'Menyisipkan, memasukan, mencelupkan atau menempatkan bahan ke dalam atau memindahkan dari mesin, atau dari peralatan otomatis, atau yang dilayani, atau yang dioperasikan oleh karyawan- karyawan lainnya.', '2018-09-01 03:26:25', '0000-00-00 00:00:00'),
(9, 'B7', 'Memegang', 'Menggunakan anggota badan, perkakas tangan atau alat khusus lain dalam mengerjakan, memindahkan atau membawa benda.', '2018-09-01 03:27:40', '0000-00-00 00:00:00'),
(10, 'D1', 'Mengkoordinasi data', 'Menentukan waktu, tempat atau urutan operasi yang akan dilaksanakan atau tindakan yang harus diambil berdasarkan hasil analisa data, melaksanakan ketentuan atau melaporkan kejadian dengan cara menghubung-hubungkan mencari kaitan sella membandingkan data setelah data tersebut dianalisa.', '2018-09-01 03:28:48', '0000-00-00 00:00:00'),
(11, 'D2', 'Menganalisis data', 'Mempelajari, mengurangi, merinci dan menilai data untuk mendapatkan kejelasan, atau menyajikan tindakan alternatif', '2018-09-01 03:29:21', '0000-00-00 00:00:00'),
(12, 'D3', 'Menyusun data', 'Mengerjakan, Menghimpun atau mengelompokkan tentang data, orang atau benda', '2018-09-01 03:30:12', '0000-00-00 00:00:00'),
(13, 'D4', 'Menghitung data', 'Mengerjakan perhitungan aritmatika, (tambah, kurang, bagi mencacah tidak termasuk dalam', '2018-09-01 03:30:57', '0000-00-00 00:00:00'),
(14, 'D5', 'Menyalin data', 'Menyalin, mencatat atau memindahkan data', '2018-09-01 03:51:18', '0000-00-00 00:00:00'),
(15, 'D6', 'Membandingkan data', 'Mengidentifikasikan persamaan atau perbedaan sifat - sifat data, orang atau benda yang dapat diamati secara langsung, serta secara fisik, dan sedikit sekali memerlukan upaya mental.', '2018-09-01 03:52:37', '0000-00-00 00:00:00'),
(16, 'O0', 'Menasehati', 'Memberi bimbingan, saran, konsultasi atau nasehat kepada perorangan atau instansi dalam pemecahan masalah berdasarkan disiplin ilmu, spiritual, atau prinsip - prinsip keahlian lainnya.', '2018-09-01 03:53:14', '0000-00-00 00:00:00'),
(17, 'O1', 'Berunding', 'Menyelesaikan masalah tukar menukar dan beradu pendapat, argumen, gagasan, dengan pihak lain membuat keputusan.', '2018-09-01 03:53:41', '0000-00-00 00:00:00'),
(18, 'O2', 'Mengajar', 'Melatih orang lain dengan memberikan penjelasan, peragaan, bimbingan teknis, atau memberikan rekomendasi atas dasar disiplin yang bersifat teknis.', '2018-09-01 03:54:12', '0000-00-00 00:00:00'),
(19, 'O3', 'Menyelia', 'Menentukan atau menafsirkan prosedur ker-ja, membagi tugas, menciptakan dan meme-lihara hubungan yang harmonis diantara bawahan dan meningkatkan efisiensi.', '2018-09-01 03:55:08', '0000-00-00 00:00:00'),
(20, '04', 'Menghibur', 'Menghibur orang lain, biasanya menggu-nakan media panggung, film, televisi dan radio.', '2018-09-01 03:55:32', '0000-00-00 00:00:00'),
(21, 'O5', 'Mempengaruhi', 'Mempengaruhi orang lain untuk memperoleh keuntungan dalam benda, jasa atau pendapat.', '2018-09-01 03:55:55', '0000-00-00 00:00:00'),
(22, 'O6', 'Berbicara - memberi tanda', 'Berbicara atau memberi tanda kepada orang lain untuk meminta, memberi informasi atau untuk mendapatkan tanggapan atau reaksi yang sifatnya tidak konseptual.', '2018-09-01 03:56:20', '0000-00-00 00:00:00'),
(23, 'O7', 'Melayani orang', 'Memenuhi kebutuhan atau permintaan orang lain atau hewan, baik yang dinya-takan atau yang tidak langsung dinyatakan tetap harus dilaksanakan menurut keten-tuan. Fungsi ini diperlukan pengetahuan dan keterampilan khusus untuk melaksana-kannya.', '2018-09-01 03:56:48', '0000-00-00 00:00:00'),
(24, 'O8', 'Menerima instruksi', 'Membantu melaksanakan kerja berdasarkan perintah atasan yang tidak memerlukan tanggapan.', '2018-09-01 03:57:16', '0000-00-00 00:00:00');
