(9, 'PDD.1.1.3', 'Analis Dana Rehabilitasi Fasilitasi Pendidikan', 'Melakukan kegiatan yang meliputi pengumpulan, pengklasifikasian dan penelaahan untuk menyipulkan dan menyusun rekomendasi di bidang dana rehabilitasi fasilitasi pendidikan', 'Pelaksana', '2018-08-28 07:13:50', '0000-00-00 00:00:00'),
(10, 'PDD.1.1.4', 'Analis Data Akademik', 'Melakukan kegiatan yang meliputi pengumpulan, pengklasifikasian dan penelaahan untuk menyimpulkan dan menyusun rekomendasi di bidang data akademik', 'Pelaksana', '2018-08-28 07:16:32', '0000-00-00 00:00:00'),
(11, 'PDD.1.1.5', 'Analis Data dan Informasi Pendidikan dan Tenaga Kependidikan', 'Melakukan kegiatan yang meliputi pengumpulan, pengklasifikasian dan penelaahan untuk menyimpulkan dan menyusun rekomendasi di bidang data dan informasi pendidikan dan tenaga kependidikan', 'Pelaksana', '2018-08-28 07:19:45', '0000-00-00 00:00:00'),
(12, 'PDD.1.1.6', 'Analis Data dan Kerjasama Diklat', 'Melakukan kegiatan yang meliputi pengumpulan, pengklasifikasian dan penelaahan untuk menyimpulkan dan menyusun rekomendasi di bidang data dan kerjasama diklat', 'Pelaksana', '2018-08-28 07:22:01', '0000-00-00 00:00:00'),
(13, 'PDD.1.1.7', 'Analis Data Kebahasaan', 'Melakukan kegiatan yang meliputi pengumpulan, pengklasifikasian dan penelaahan untuk menyimpulkan dan menyusun rekomendasi di bidang data kebahasaan', 'Pelaksana', '2018-08-28 07:33:57', '0000-00-00 00:00:00'),
