(3956, 'SOS.0.04', 'Kepala bidang Rehabilitasi Sosial', 'Merumuskan Kebijakan Teknis, Pemberian Bimbingan Teknis, Melaksanakan Program dan Pelayanan serta Pemantauan dan Evaluasi di Bidang Pelayanan dan Rehabilitasi Sosial', 'IIIA', '2018-09-19 02:57:04', '0000-00-00 00:00:00'),
(3957, 'SKD.0.0.3', 'Staf Ahli Bupati Bidang Ekonomi, Pembangunan dan Keuangan', 'Membantu Bupati dalam menyampaikan pemikiran, saran, pertimbangan dan telaah yang berkaitan dengan tugas, kewenangan dan kewajiban Bupati dibidang ekonomi, pembangunan dan keuangan sesuai ketentuan dan peraturan perundang-undangan yang berlaku  sebagai bahan masukan pengambilan kebijakan.\r\n\r\n', 'IIB', '2018-09-19 08:07:42', '0000-00-00 00:00:00'),
(3958, 'PUPR', 'Sekretaris Dinas Pekerjaan Umum dan Perumahan Rakyat', 'Memimpin dan melaksanakan program operasional pada Sekretariat Dinas Pekerjaan Umum dan Perumahan Rakyat sesuai dengan peraturan yang berlaku agar tugas terlaksana tepat waktu', 'IIIA', '2018-09-24 05:12:27', '0000-00-00 00:00:00'),
(3959, '36.1.12', 'pengadministrasi rehabilitasi sosial penyandang cacat', 'Melakukan Kegiatan pengelolaan yang meliputi penyiapan bahan, koordinasi dan penyusunan laporan untuk disajikan kepada pimpinan', 'Pelaksana', '2018-09-25 19:00:45', '0000-00-00 00:00:00'),
