INSERT INTO `master_temperamen_kerja` (`id`, `kode`, `nama`, `keterangan`, `created_at`, `updated_at`) VALUES
(1, 'D', 'Directing -Control-Planning (DCP) ', 'Kemampuan menyesuaikan diri menerima tanggung jawab untuk kegiatan memimpin, mengendalikan atau merencanakan.', '2018-08-07 04:08:38', '2018-08-07 04:08:38'),
(2, 'F', 'Feeling-Idea-Fact (FIF)', 'Kemampuan menyesuaikan diri dengan kegiatan yang mengandung penafsiran perasaan, gagasan atau fakta dari sudut pandangan pribadi.', '2018-09-01 02:12:35', '0000-00-00 00:00:00'),
(3, 'I', 'Influencing (INFLU)', 'Kemampuan menyesuaikan diri untuk pekerjaan - pekerjaan mempengaruhi orang lain dalam pendapat, sikap atau pertimbangan mengenai gagasan.', '2018-09-01 02:13:09', '0000-00-00 00:00:00'),
(4, 'J', 'Sensory & Judgmental Creteria (SJC)', 'Kemampuan menyesuaikan diri pada kegiatan perbuatan kesimpulan penilaian atau pembuatan peraturan berdasarkan kriteria rangsangan indera atau atas dasar pertimbangan pribadi.', '2018-09-01 02:13:54', '0000-00-00 00:00:00'),
(5, 'M', 'Measurable and Verifiable Creteria (MVC)', 'Kemampuan menyesuaikan diri dengan kegiatan pengambilan peraturan, pembuatan pertimbangan, atau pembuatan peraturan berdasarkan kriteria yang diukur atau yang dapat diuji.', '2018-09-01 02:14:23', '0000-00-00 00:00:00'),
(6, 'P', 'Dealing with People (DEPL)', 'Kemampuan menyesuaikan diri dalam berhubungan dengan orang lain lebih dari hanya penerimaan dan pembuatan instruksi.', '2018-09-01 02:15:10', '0000-00-00 00:00:00'),
(7, 'R', 'Repetitive and Continuous (REPCON)', 'Kemampuan menyesuaikan diri dalam kegiatan-kegiatan yang berulang, atau secara terus menerus melakukan kegiatan yang sama, sesuai dengan perangkat prosedur, urutan atau kecepatan yang tertentu.', '2018-09-01 02:15:51', '0000-00-00 00:00:00'),
(8, 'S', 'Performing under Stress (PUS)', 'Kemampuan menyesuaikan diri untuk bekerja dengan ketegangan jiwa jika berhadapan dengan keadaan darurat, kritis, tidak biasa atau bahaya, atau bekerja dengan kecepatan kerja dan perhatian terus menerus merupakan keseluruhan atau sebagian aspek pekerjaan.', '2018-09-01 02:17:36', '0000-00-00 00:00:00'),
(9, 'T', 'Set of Limits, Tolerance and Other Standart (STS)', 'Kemampuan menyesuaikan diri dengan situasi yang menghendaki pencapaian dengan tepat menurut perangkat batas, toleransi atau standar-standar tertentu.', '2018-09-01 02:34:29', '0000-00-00 00:00:00'),
(10, 'V', 'Variety and Changing Conditions (VARCH)', 'Kemampuan menyesuaikan diri untuk melaksanakan berbagai tugas, sering berganti dari tugas yang satu ke tugas yang lainnya yang &#34;berbeda&#34; sifatnya, tanpa kehilangan efisiensi atau ketenangan diri', '2018-09-01 02:35:09', '0000-00-00 00:00:00');
