INSERT INTO `master_upaya_fisik` (`id`, `nama`, `keterangan`, `created_at`, `updated_at`) VALUES
(1, 'Berdiri', 'Berada di suatu tempat dalam posisi tegak ditempat tanpa pindah ke tempat lain.', '2018-09-01 02:39:53', '2018-09-01 02:39:53'),
(2, 'berjalan', 'Bergerak dengan jalan kaki.', '2018-08-14 07:01:24', '0000-00-00 00:00:00'),
(3, 'Duduk', 'Berada dalam suatu tempat dalam posisi duduk biasa.', '2018-09-01 02:40:14', '0000-00-00 00:00:00'),
(4, 'Mengangkat', 'Menaikkan atau menurunkan benda di satu tingkat ke tingkat lain (termasuk menarik ke atas).', '2018-09-01 02:40:54', '0000-00-00 00:00:00'),
(5, 'Membawa', 'Memindahkan benda, umumnya dengan menggunakan tang an, lengan atau bahu.', '2018-09-01 02:44:36', '0000-00-00 00:00:00'),
(6, 'Mendorong', 'Menggunakan tenaga untuk memindahkan benda menjauhi badan.', '2018-09-01 02:45:07', '0000-00-00 00:00:00'),
(7, 'Menarik', 'Menggunakan tenaga untuk memindahkan suatu benda ke arah badan (termasuk menyentak atau merenggut).', '2018-09-01 02:45:34', '0000-00-00 00:00:00'),
(8, 'Memanjat', 'Naik atau turun tangga, tiang, lorong dan Iain-Iain dengan menggunakan kaki, tangan, dan kaki.', '2018-09-01 02:46:12', '0000-00-00 00:00:00'),
(9, 'Menyimpan imbangan / mengatur imbangan', 'Agar tidak jatuh badan waktu berjalan, berdiri, membungkuk, atau beiiari di atas tempat yang agak sempit, licin dan tinggi tanpa alat pegangan, atau mengatur imbang­an pada waktu melakukan olah raga senam.', '2018-09-01 02:46:38', '0000-00-00 00:00:00'),
(10, 'Menunduk', 'Melengkungkan tubuh dengan cara melekukkan tulang punggung dan kaki.', '2018-09-01 02:47:03', '0000-00-00 00:00:00'),
(11, 'Berlutut', 'Melengkungkan paha kaki pada lutut dan berdiam di suatu tempat dengan tubuh diatas lutut.', '2018-09-01 02:47:27', '0000-00-00 00:00:00'),
(12, 'Membungkuk', 'Melengkungkan tubuh dengan cara meleng­kungkan tulang punggung sampai kira-kira sejajar dengan pinggang.', '2018-09-01 02:47:57', '0000-00-00 00:00:00'),
(13, 'Merangkak', 'Bergerak dengan menggunakan tangan dan lutut atau kaki dan tangan.', '2018-09-01 02:52:25', '0000-00-00 00:00:00'),
(14, 'Menjangkau', 'Mengulurkan tangan dan lengan ke jurusan tertentu.', '2018-09-01 02:52:50', '0000-00-00 00:00:00'),
(15, 'Memegang', 'Dengan satu atau dua tangan mengukur, menggenggam, memutar dan lain sebagainya.', '2018-09-01 02:53:17', '0000-00-00 00:00:00'),
(16, 'Bekerja dengan jari', 'Memungut, menjepit, menekan dan lain sebagainya dengan menggunakan jari (berbeda dengan &#34;memegang&#34; yang terutama menggunakan seluruh bagian tangan).', '2018-09-01 02:53:38', '0000-00-00 00:00:00'),
(17, 'Meraba', 'Menyentuh dengan jari atau telapak tangan untuk mengetahui sifat-sifat benda seperti, suhu, bentuk.', '2018-09-01 03:02:10', '0000-00-00 00:00:00'),
(18, 'Berbicara', 'Menyatakan atau bertukar pikiran secara lisan agar dapat dipahami.', '2018-09-01 03:03:13', '0000-00-00 00:00:00'),
(19, 'Mendengar', 'Menggunakan telinga untuk mengetahui adanya suara.', '2018-09-01 03:03:35', '0000-00-00 00:00:00'),
(20, 'Melihat', 'Usaha mengetahui dengan menggunakan mata.', '2018-09-01 03:03:55', '0000-00-00 00:00:00'),
(21, 'Ketajaman jarak jauh', 'Kejelasan penglihatan dalam jarak lebih dari 5 meter.', '2018-09-01 03:04:22', '0000-00-00 00:00:00'),
(22, 'Ketajaman jarak dekat', 'Kejelasan penglihatan kejelasan dalam jarak kurang dari 5 meter.', '2018-09-01 03:04:45', '0000-00-00 00:00:00'),
(23, 'Pengamatan secara mendalam', 'Penglihatan dalam 3 dimensi, untuk menetapkan hubungan antara jarak, ruang serta cara melihat benda dimana benda tersebut berada dan sebagaimana adanya.', '2018-09-01 03:05:08', '0000-00-00 00:00:00'),
(24, 'Penyesuaian lensa mata', 'Penyesuaian lensa mata untuk melihat suatu benda yang sangat penting bila melaksanakan pekerjaan yang perlu dengan melihat benda-benda dalam jarak dan arah yang berbeda.', '2018-09-01 03:05:31', '0000-00-00 00:00:00'),
(25, 'Melihat berbagai warna', 'Membedakan warna yang terdapat dalam pekerjaan.', '2018-09-01 03:05:53', '0000-00-00 00:00:00'),
(26, 'Luas', 'Melihat suatu daerah pandang, ke atas dan ke bawah pandang atau ke kanan atau ke kiri sedang mata tetap berada di titik tertentu.', '2018-09-01 03:06:13', '0000-00-00 00:00:00');
